import React from 'react';
import { Link } from 'react-router-dom';

const AllChats = () => {
  // Example dummy data
  const chats = [
    { userId: 'user1' },
    { userId: 'user2' },
    { userId: 'user3' },
    { userId: 'user4' },
    { userId: 'user5' },
  ];

  return (
    <div style={{ paddingLeft: '100px', marginTop: '7rem' }}>
      <h1>All Chats</h1>
      <div>
        {chats.map((chat, index) => (
          <div key={index}>
            <Link to={`/chat/${chat.userId}`}>
              <div style={{ border: '1px solid #ccc', padding: '10px', marginBottom: '10px', cursor: 'pointer' }}>
                Chat with User ID: {chat.userId}
              </div>
            </Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AllChats;
